/* 
Texts associació, als path s'ha de posar el path per arribar fins la seva pàg
Al title s'hi posa el text que es vol mostrar
I al cName és el class name s'hi ha de posar 'dropdown-link'
*/

export const MenuItems = [
    {
      title: 'Valors',
      path: '/valors',
      cName: 'dropdown-link'
    },
    {
      title: 'Fundació Esplai',
      path: 'https',
      cName: 'dropdown-link'
    },
    {
      title: 'Fes-te Soci',
      path: '/soci',
      cName: 'dropdown-link'
    }
  ];
